var allData = {};
var allPosters = {};
var allRatings = {};
var temp = Object.entries(movieList)
temp.forEach( _ => {
    var currMovieDetails = _[1];
    var currentID = currMovieDetails.imdbID;
    if(!allData[currentID]){
        allPosters[currentID] = currMovieDetails.Poster;
        var ratingsAndAwards = {};
        Object.assign(ratingsAndAwards, calculateRatings(currMovieDetails["Ratings"]));
        Object.assign(ratingsAndAwards, {
            "IMDBVotes": currMovieDetails["imdbVotes"],
            "Awards": currMovieDetails["Awards"]
        });
        allRatings[currentID] = ratingsAndAwards;
        delete currMovieDetails["Awards"];
        delete currMovieDetails["Poster"];
        delete currMovieDetails["Ratings"];
        delete currMovieDetails["Metascore"];
        delete currMovieDetails["imdbRating"];
        delete currMovieDetails["imdbVotes"];
        allData[currentID] = currMovieDetails;
    }
})

function calculateRatings(arr){
    var obj = {}
    arr.forEach( _ => {
        switch (_["Source"]) {
            case "Internet Movie Database": obj["IMDB"] = _["Value"]; break;
            case "Rotten Tomatoes": obj["RottenTomatoes"] = _["Value"]; break;
            case "Metacritic": obj["Metacritic"] = _["Value"]; break;
        }
    });
    return obj;
}
